import "./App.css";
import React from "react";
import { Switch, BrowserRouter as Router, Route } from "react-router-dom";
import Web19201 from "./components/Web19201";
import Web19202 from "./components/Web19202";
import image1 from "./static/img/image-1@1x.png";
import arrow from "./static/img/arrow-@1x.png";
import country1 from "./static/img/country-1@1x.png";
import country11 from "./static/img/country-1-1@1x.png";
import country111 from "./static/img/country-1-1-1x-png@1x.png";
import country12 from "./static/img/country-1-2@1x.png";

class App extends React.Component {
  render() {
    return (
      <Router>
        <Switch>
          <Route path="/:path(|web-1920-1)">
            <Web19201
              image1={image1}
              covid="Covid"
              query="Query"
              filterProps={web19201Data.filterProps}
              country1Props={web19201Data.country1Props}
              country2Props={web19201Data.country2Props}
              commodityProps={web19201Data.commodityProps}
            />
          </Route>
          <Route path="/web-1920-2">
            <Web19202
              image1={image1}
              covid="Covid"
              query="Query"
              filter2Props={web19202Data.filter2Props}
              country12Props={web19202Data.country12Props}
              country22Props={web19202Data.country22Props}
              commodity2Props={web19202Data.commodity2Props}
            />
          </Route>
        </Switch>
      </Router>
    );
  }
}

export default App;
const filterData = {
    title: "Value",
    arrow: {arrow},
};

const country1Data = {
    overlapGroup: {country1},
    country1: "All",
    arrow: {arrow},
};

const country2Data = {
    country2: "USA",
    union3: {arrow},
};

const commodityData = {
    commodity: "Commodity",
    union3: {arrow},
};

const web19201Data = {
    image1: {image1},
    covid: "Covid",
    query: "Query",
    filterProps: filterData,
    country1Props: country1Data,
    country2Props: country2Data,
    commodityProps: commodityData,
};

const filter2Data = {
    arrow: {arrow},
    filters: "Filters",
    value: "Value",
    weight: "Weight",
};

const countries1Data = {
    countries: {country11},
};

const country12Data = {
    country11: {country1},
    arrow: {arrow},
    country12: "Import",
    countriesProps: countries1Data,
};

const countries2Data = {
    countries: {country12},
    className: "countries-1",
};

const country22Data = {
    place: "Export",
    union3: {arrow},
    countriesProps: countries2Data,
};

const commodity2Data = {
    commodity: "Commodity",
    union3: {arrow},
};

const web19202Data = {
    image1: {image1},
    covid: "Covid",
    query: "Query",
    filter2Props: filter2Data,
    country12Props: country12Data,
    country22Props: country22Data,
    commodity2Props: commodity2Data,
};
